SELECT DISTINCT bar, drinker FROM frequents

EXCEPT

(
SELECT DISTINCT t1.bar, t1.drinker
FROM frequents AS T1, frequents AS T2
WHERE T1.times_a_week < T2.times_a_week AND T1.bar = T2.bar
);

(SELECT bar, drinker FROM frequents) 

EXCEPT ALL

(SELECT frequents.bar, frequents.drinker FROM frequents, frequents as f1 WHERE f1.bar = frequents.bar AND f1.times_a_week > frequents.times_a_week);

SELECT bar, drinker FROM Frequents
EXCEPT
(SELECT Frequents1.bar, Frequents2.drinker FROM Frequents AS Frequents1, Frequents AS Frequents2 WHERE (Frequents1.times_a_week > Frequents2.times_a_week AND Frequents1.bar = Frequents2.bar));

SELECT DISTINCT F2.bar, F2.drinker
FROM Frequents as F1, Frequents as F2
WHERE F1.times_a_week < F2.times_a_week;

SELECT Frequents.bar, drinker FROM Frequents,
(SELECT bar, MAX(times_a_week) FROM Frequents GROUP BY bar) AS Max_freq
WHERE Frequents.bar = Max_freq.bar AND Frequents.times_a_week =  Max_freq.max;

--(g) For each bar, find the drinker who frequents it the greatest number of times. Your output should be a list of (bar, drinker) pairs. If multiple drinkers tie for the most frequent visitor to a bar, list them all as separate pairs. 
select frequents.bar, frequents.drinker
from frequents, (select bar, max(times_a_week)
                 from frequents
                 group by bar) as most_frequent  -- Maximum times a week for each bar
where frequents.bar = most_frequent.bar and frequents.times_a_week = most_frequent.max;

SELECT DISTINCT f1.bar, drinker
FROM frequents f1
  JOIN (
    SELECT bar, max(times_a_week) AS max_freq FROM frequents GROUP BY bar
  ) AS f2
    ON f1.bar = f2.bar AND f1.times_a_week = max_freq;

select distinct bar, drinker from frequents as f where (bar, drinker) not in (select f1.bar, f1.drinker from frequents f1 join frequents f2 on f1.bar = f2.bar where f1.times_a_week < f2.times_a_week);

