/* For each bar, find the drinker who frequents it the most. */

SELECT bar, drinker
FROM frequents AS f
WHERE NOT EXISTS (
    SELECT drinker 
    FROM frequents
    WHERE f.bar = frequents.bar
    AND frequents.times_a_week > f.times_a_week
);

select bar, drinker 
from (select rank() over (partition by bar order by times_a_week desc) as rank, bar, drinker, times_a_week 
	  from frequents)A where rank = 1;

(SELECT bar, drinker FROM frequents) 

EXCEPT ALL

(SELECT DISTINCT frequents.bar, frequents.drinker FROM frequents, frequents as f1 WHERE f1.bar = frequents.bar AND frequents.times_a_week < f1.times_a_week); 

